import pandas as pd


def Result():
    a = []

    def Subsequences(arr, index, subarr):
        if index == len(arr):
            if len(subarr) == 2 or len(subarr) == 3:
                a.append(subarr)

        else:
            Subsequences(arr, index + 1, subarr)
            Subsequences(arr, index + 1, subarr + [arr[index]])
        return a


    class TrieNode:  # creating node dict{char:TrieNode} boolean flag
        def __init__(self):
            self.children = {}
            self.End = False


# class for Trie structure
    class Trie:
        def __init__(self):
            self.root = TrieNode()

        def insert(self, word: list) -> None:
            itr = self.root
            for c in word:
                if c not in itr.children:
                    itr.children[c] = TrieNode()
                itr = itr.children[c]
            itr.End = True

        def recommend(self, word: list) -> list():
            itr = self.root
            for c in word:
                if c not in itr.children:
                    self.insert(word)
                    return None
                itr = itr.children[c]
            return list(itr.children.keys())


